exports=async function(bid,options){const{parseCatalogPaginate}=await require("transcode/parse_catalog"),clientOptions={...(options&&options.clientOptions)};return parseCatalogPaginate(page=>`http://www.biquke.me/l${bid.idPrefix()}-${bid}/${1===page?"":"index_"+page+".html"}`,".section-list",{...options,clientOptions,pageSize:20,totalPagesRegex:/value="\/l\d+-\d+\/index_(?<totalPages>\d+)\.html"[^>]*>[^<]+<\/option>\s*<\/select/})};